let name = "Emmanuel";
const thoughts = "is awesome and is going to make me lots of money!";

const remove_vowels = name => name.replace(/[aeiou]/gi, '');

const JSXVariables = () =>(
    <div className="main-container">
      <div className="container">
        <div className="jumbotron">
          <h1>Hi! My name is {name}</h1>
          <h2>My name has {name.length} letters</h2>
          <h2>I think React {thoughts}</h2>
          <h2>My name without any vowels is: {remove_vowels()}</h2>
        </div>
      </div>
    </div>
  );

export default JSXVariables;
